import React from "react";
class Naveen extends React. Component{
    constructor(props){
        super();
        this.State={
            name:"naveen",
            city:"tadipatri",
            value:"well come"
        }
    }
      handleChange=()=>{
        this.setState({
            name:"chinna",
            city:"ppr",
            value:"send of"

        })
      }


    render(){
        return(
            <div>
                {this.State.name}<br></br>
                {this.State.city}<br></br>
                {this.State.value}
                <br></br>

                <button onClick={this.handleChange}>udate</button>
            </div>
        )
    }
}
export default Naveen;
